=>'Autora arhīvs:','Template nameCategory Archives'=>'Kategoriju arhīvi','Template nameDate Archives'=>'Datuma arhīvi','Template nameTag Archives'=>'Birku arhīvi','Attachment Pages'=>'Pielikuma lapas','Template nameSearch Results'=>'Meklēšanas rezultāti','Template namePage: 404'=>'Lapa: 404','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'Parāda pielāgotu taksonomijas arhīvu. Tāpat kā kategorijām un birkām, taksonomijām ir termini, kurus izmantojat lietu klasificēšanai. Piemēram: taksonomijā ar nosaukumu "Māksla" var būt vairāki termini, piemēram, "modernā" un "18. gadsimta". Šī veidne kalpos kā rezerves variants, ja nevarēs atrast specifiskāku veidni (piemēram, Taksonomija: Māksla).','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'Parāda ziņu arhīvu, kad tiek apmeklēts noteikts datums (piemēram, example.com/2023/).','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'Parāda ziņu birku arhīvu. Šī veidne kalpos kā rezerves variants, ja nevarēs atrast specifiskāku veidni (piemēram, Birka: Picas).','Displays when a visitor views the dedicated page that exists for any media attachment.'=>'Tiek rādīts, kad apmeklētājs apskata jebkuram multivides pielikumam paredzēto lapu.','Displays when a visitor performs a search on your website.'=>'Tiek rādīts, kad apmeklētājs veic meklēšanu jūsu vietnē.','Displays your site\'s Privacy Policy page.'=>'Parāda jūsu vietnes konfidencialitātes politikas lapu.','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'Tiek rādīts, kad apmeklētājs skatās neesošu lapu, piemēram, nederīgu saiti vai kļūdaini