d navigation to next/previous set of comments, when applicable.'=>'Parāda lappušu navigāciju uz nākamo/iepriekšējo komentāru kopu, ja piemērojams.','block descriptionDisplays a link to reply to a comment.'=>'Parāda saiti, lai atbildētu uz komentāru.','block titleComment Template'=>'Komentāra veidne','block descriptionContains the block elements used to display a comment, like the title, date, author, avatar and more.'=>'Ietver bloka elementus, ko izmanto, lai parādītu komentāru, piemēram, nosaukumu, datumu, autoru, tēlu un citus.','block descriptionDisplays the next comment\'s page link.'=>'Parāda nākamā komentāra lapas saiti.','block descriptionDisplays a list of page numbers for comments pagination.'=>'Parāda lapu numuru sarakstu komentāru lappušu šķirošanai.','block descriptionDisplays the contents of a comment.'=>'Parāda komentāra saturu.','block titleComment Edit Link'=>'Labot komentāru saiti','block descriptionDisplays a link to edit the comment in the WordPress Dashboard. This link is only visible to users with the edit comment capability.'=>'Parāda saiti, lai rediģētu komentāru WordPress informācijas panelī. Šī saite ir redzama tikai tiem lietotājiem, kuriem ir iespēja rediģēt komentārus.','block titleComment Reply Link'=>'Atbildes saite uz komentāru','block descriptionDisplays the date on which the comment was posted.'=>'Parāda datumu, kad komentārs tika publicēts.','block titleComment Author Name'=>'Komentārs Autora vārds','block titleAvatar'=>'Tēls(avatārs)','block descriptionDisplays the name of the author of the comment.'=>'Parāda komentāra autora vārdu.','block descriptionAdd a user’s avatar.'=>'Pievieno lietotāja tēlu.','A WordPress Commenter'=>'WordPress komentētājs','Response to %s'=>'Atbilde uz %s','Responses to %s'=>'Atbildes uz %s','block titleComment Date'=>'Ziņas komentāra datums','block titleComment Content'=>'Ziņas komentāra saturs','Default Avatar'=>'Noklusējuma tēls(avatārs)','There is already a ping from that URL for this post.'=>'Šai ziņai jau ir ping no šī URL.','Alignment optionNone'=>'Nav','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'Vai nepieciešama papildu palīdzība? <a href="%1$s">Izlasiet atbalsta rakstu par %2$s</a>.','The password cannot be a space or all spaces.'=>'Parole nevar būt atstarpe vai tikai atstarpes.','The database server could be connected to (which means your username and password is okay) but the %s database could not be selected.'=>'Datubāzes serverim varēja izveidot savienojumu (tas nozīmē, ka jūsu lietotājvārds un parole ir pareizi), bet %s datubāzi nevarēja atlasīt.','Cannot select database'=>'Nevar atlasīt datu bāzi','Sorry, the video at the supplied URL cannot be loaded. Please check that the URL is for a supported video file (%s) or stream (e.g. YouTube and Vimeo).'=>'Atvainojiet, pievienotajā URL adresē norādīto videoklipu nevar ielādēt. Lūdzu, pārbaudiet, vai URL attiecas uz atbalstītu video failu (%s) vai straumi (piemēram, YouTube un Vimeo).','That file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Šis fails nav atrodams. Pārbaudiet savu <a href="%s">multivides bibliotēku</a> un pārliecinieties, vai tas nav izdzēsts.','That image cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Šis attēls nav atrodams. Pārbaudiet savu <a href="%s">multivides bibliotēku</a> un pārliecinieties, vai tas nav dzēsts.','That video cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Šis video nav atrodams. Pārbaudiet savu <a href="%s">multivides bibliotēku</a> un pārliecinieties, vai tas nav dzēsts.','That audio file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Šis audio fails nav atrodams. Pārbaudiet savu <a href="%s">multivides bibliotēku</a> un pārliecinieties, vai tas nav dzēsts.','User URL may not be longer than 100 characters.'=>'Lietotāja URL nedrīk