ong> šī nav derīga plūsmas veidne.','The description will be displayed in the menu if the active theme supports it.'=>'Apraksts tiks parādīts izvēlnē, ja aktīvā tēma to atbalsta.','A title on that page cannot be found.'=>'Šajā lapā virsraksts nav atrodams.','color schemeDark'=>'Tumšs','color schemeLight'=>'Gaišs','<strong>Error:</strong> The themes directory is either empty or does not exist. Please check your installation.'=>'<strong>Kļūda:</strong> tēmu direktorijs ir tukšs vai neeksistē. Lūdzu, pārbaudiet savu instalāciju.','File does not exist?'=>'Fails neeksistē?','Adding an RSS feed to this site’s homepage is not supported, as it could lead to a loop that slows down your site. Try using another block, like the <strong>Latest Posts</strong> block, to list posts from the site.'=>'RSS plūsmas pievienošana šīs vietnes sākumlapai netiek atbalstīta, jo tā var izraisīt cilpu, kas palēninās vietnes darbību. Mēģiniet izmantot citu bloku, piemēram, bloku <strong>Jaunākās ziņas</strong>, lai uzskaitītu ziņas no vietnes.','%s Avatar'=>'%s tēls','(%s author archive, opens in a new tab)'=>'(autora %s arhīvs, tiek atvērts jaunā cilnē)','(%s website link, opens in a new tab)'=>'(%s vietnes saite, tiek atvērta jaunā cilnē)','Newer Comments'=>'Jaunāki komentāri','Older Comments'=>'Senāki komentāri','Response'=>'Atbilde','Responses'=>'Atbildes','Could not register file "%s" as a block pattern ("Slug" field missing)'=>'Nevarēja reģistrēt failu "%s" kā bloka modeli (trūkst lauks "Taka")','Could not register file "%1$s" as a block pattern (invalid slug "%2$s")'=>'Nevarēja reģistrēt failu "%1$s" kā bloka modeli (nederīga taka "%2$s")','Could not register file "%s" as a block pattern ("Title" field missing)'=>'Nevarēja reģistrēt failu "%s" kā bloka modeli (trūkst lauks "Nosaukums")','Block pattern categoryFeatured'=>'Piedāvātie','Use Site Editor'=>'Izmantojiet vietnes redaktoru','Hurray! Your theme supports site editing with blocks. <a href="%1$s">Tell me more</a>. %2$s'=>'Urā! Jū