>'Pieejama jauna versija.','Could not insert term taxonomy into the database.'=>'Nevarēja ievietot termina taksonomiju datubāzē.','<a href="%1$s" %2$s>Learn how to describe the purpose of the image%3$s</a>. Leave empty if the image is purely decorative.'=>'<a href="%1$s" %2$s>Uzziniet, kā aprakstīt attēla mērķi%3$s</a>. Atstāj tukšu, ja attēls ir tikai dekoratīvs.','In this case, WordPress caught an error with your theme, %s.'=>'Šajā gadījumā, WordPress atrada kļūdu jūsu tēmā %s.','In this case, WordPress caught an error with one of your plugins, %s.'=>'Šajā gadījumā, WordPress atrada kļūdu vienā no jūsu spraudņiem - %s.','Howdy!

WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Sveicināti!

WordPress ir iebūvēta funkcija, kas nosaka, kad spraudnis vai tēma izraisa fatālu kļūdu jūsu vietnē, un informē jūs ar šo automātisko e-pastu.
###CAUSE####
Vispirms apmeklējiet savu vietni (###SITEURL###) un pārbaudiet, vai nav redzamu problēmu. Pēc tam apmeklējiet lapu, kurā konstatēta kļūda (###PAGEURL###), un pārbaudiet, vai nav redzamu problēmu.

###SUPPORT###

Ja jūsu vietne šķiet bojāta un jūs nevarat normāli piekļūt savam panelim, WordPress tagad ir īpašs "atkopšanas režīms". Tas ļauj droši pieteikties vadības panelī un turpināt pētījumus.

###LINK###

Lai jūsu vietne būtu droša, šī saite beigsies ###EXPIRES###. Tomēr par to neuztraucieties: ja pēc tās derīguma termiņa beigām kļūda atkārtosies, jums pa e-pastu tiks nosūtīta jauna saite.

Meklējot palīdzību saistībā ar šo problēmu, jums var tikt pieprasīta šāda informācija:
