###SITEURL###','Scrape key check failed. Please try again.'=>'Skrāpēšanas atslēgas pārbaude neizdevās. Lūdzu mēģiniet vēlreiz.','%s themes'=>'%s tēmas','Go to theme sources'=>'Atpakaļ pie tēmu avotiem','Search WordPress.org themes'=>'Meklēt WordPress.org tēmās','Install &amp; Preview'=>'Uzstādīt un priekšstatīt','Filter themes (%s)'=>'Filtrēt tēmas (%s)','Only UUID V4 is supported at this time.'=>'Šobrīd tiek atbalstīts vienīgi UUID V4.','The Press This plugin is required.'=>'Nepieciešams Press This spraudnis.','Invalid URL.'=>'Nederīgs URL.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'Laiks pievienot dažas saites! Klikšķiniet uz &#8220;%s&#8221;, lai pievienotu lapas, kategorijas un pielāgotas saites savai izvēlnei. Pievienojiet tik daudz lietas, cik vien vēlaties.','Choose image'=>'Izvēlies attēlu','Choose audio'=>'Izvēlēties audio','Change audio'=>'Mainīt audio','Select audio'=>'Atlasīt audio','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klikšķiniet uz &#8220;Pievienot jaunu attēlu&#8221;, lai augšupielādētu attēla failu no sava datora. Jūsu tēma labāk darbosies, ja galvenes attēla augstums būs %s pikseļi &#8212; pēc augšupielādēšanas, varēsiet apgriezt savu attēlu, ideālai saderībai.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klikšķiniet uz &#8220;Pievienot jaunu attēlu&#8221;, lai augšupielādētu attēla failu no sava datora. Jūsu tēma labāk darbosies, ja galvenes attēla platums būs %s pikseļi &#8212; pēc augšupielādēšanas, varēsiet apgriezt savu attēlu, ideālai saderībai.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klikšķiniet uz &#8220;Pievienot jaunu attēlu&#8221;, lai augšupielādētu attēla failu no sava datora. Jūsu tēma labāk darbosies, ja galvenes attēla izmērs būs %s pikseļi &#8212; pēc augšupielādēšanas, varēsiet apgriezt savu attēlu, ideālai saderībai.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klikšķiniet uz &#8220;Pievienot jaunu attēlu&#8221;, lai augšupielādētu attēla failu no sava datora. Jūsu tēma labāk darbosies, ja attēla izmērs sakritīs ar jūsu video izmēru &#8212; pēc augšupielādēšanas, varēsiet apgriezt savu attēlu, ideālai saderībai.','Minute'=>'Minūte','Hour'=>'Stunda','Time'=>'Laiks','Day'=>'Diena','Month'=>'Mēnesis','Date'=>'Datums','New Menu'=>'Jauna izvēlne','Name for the Visual editor tabVisual'=>'Vizuāls','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Ja jūsu vietnei ir logrīku apgabali, jūs varat pievienot izvēlnes arī tur. Atveriet <a href="%s">logrīku paneli</a> un pievienojiet&#8220;navigācijas izvēlnes logrīku&#8221; lai parādītu izvēlni sānjoslā vai kājenē.','Meridian'=>'Meridiāns','%1$s-%2$s'=>'%1$s-%2$s','Usage of user levels is deprecated. Use capabilities instead.'=>'Lietotāju līmeņu izmantošana vairs netiek atbalstīta. Tā vietā izmantojiet lietotāju iespējas.','The theme defines itself as its parent theme. Please check the %s header.'=>'Tēma sevi definē kā vecāka tēmu. Lūdzu, pārbaudiet %s galveni.','Create New Menu'=>'Izveidot jaunu izvēlni','CSS code'=>'CSS kods','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Ja jūsu tēmai ir vairākas izvēlnes, nosaucot tās viegli atpazīstamos vārdos, būs vieglāk tās pārvaldīt.','Your theme can display menus in %s location.'=>'Jūsu tēma var attēlot izvēlnes %s. vietā.' . "\0" . 'Jūsu tēma var attēlot izvēlnes %s. vietās.' . "\0" . 'Jūsu tēma var attēlot izvēlnes %s vietās.','Your theme can display menus in one location.'=>'Jūsu tēma var attēlot izvēlnes vienā vietā.','When using a keyboard to navigate:'=>'Kad izmantojat tastatūru, lai pārlūkotu:','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Jūs varat izvēlēties, kas tiek norādīts jūsu vietnes sākumlapā. Tās varētu būt ziņas apgrieztā hronoloģiskā secībā (klasisks blogs), vai arī tā varētu būt fiksēta/statiska lapa. Lai iestatītu statisku sākumlapu, jums vispirms jāizveido divas lapas. Viena kļūs par sākumlapu un otrā atradīsies jūsu ziņas.','Add your own CSS code here to customize the appearance and layout of your site.'=>'Ievadiet šeit savu CSS kodu, lai pielāgotu jūsu vietnes izskatu un izkārtojumu.','To move away from this area, press the Esc key followed by the Tab key.'=>'Lai pārvietotos prom no šī apgabala, spiediet Esc un tad Tab taustiņu.','Your homepage displays'=>'Sākuma lapa rāda','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Rediģēšanas lauks automātiski izceļ koda sintakse. Lai strādātu vienkārša teksta režīmā, variet to atspējot savā <a href="%1$s" %2$s>lietotāja profilā%3$s</a>.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'Ekrāna lasītāju lietotājiem: atrodoties formu režīmā, jums 